// Granite.js
import React from 'react';

const tabletopImages = [
  {
    image: 'tabletop1.jpg',
    title: 'Table Top 1',

  },
  {
    image: 'tabletop2.jpg',
    title: 'Table Top 2',
  },
  {
    image: 'tabletop3.jpg',
    title: 'Table Top 3',

  },
  {
    image: 'tabletop4.jpg',
    title: 'Table Top 4',

  },
  {
    image: 'tabletop5.jpg',
    title: 'Table Top 5',

  },
  {
    image: 'tabletop6.jpg',
    title: 'Table Top 6',

  },
];

function TableTops() {
  return (
    <div className="left-container">
      <div className="row">
        {tabletopImages.slice(0, 3).map((product, index) => (
          <div key={index} className="col-md-4 mb-5">
            <img src={product.image} alt={product.title} className="stone-img" />
            <h5>{product.title}</h5>
               
          </div>
        ))}
      </div>
      <div className="row">
        {tabletopImages.slice(3, 6).map((product, index) => (
          <div key={index} className="col-md-4 mb-5">
          <img src={product.image} alt={product.title} className="stone-img" />
          <h5>{product.title}</h5>
             
        </div>
        ))}
      </div>
    </div>
  );
}

export default TableTops;
